/* eslint-disable no-return-assign */
import React, { useEffect } from 'react';
import styled from 'styled-components';

function LoginModal() {
	useEffect(() => {
		document.body.style = `overflow: hidden`;
		return () => (document.body.style = `overflow: auto`);
	}, []);

	return (
		<LoginModalRoot>
			<div className="content-modal-wrapper content-modal-regular">
				<div className="ModalHeader Header_Header__0d6dF">
					<i className="icon-logo" />
					<button type="button">
						<svg
							width="24"
							height="24"
							viewBox="0 0 24 24"
							color="#999"
						>
							<path
								fill="currentColor"
								d="M17.97 19.03a.75.75 0 001.06-1.06l-6.5-6.5a.75.75 0 00-1.06 0l-6.5 6.5a.75.75 0 001.06 1.06L12 13.06l5.97 5.97zM12 10.94L6.03 4.97a.75.75 0 00-1.06 1.06l6.5 6.5a.75.75 0 001.06 0l6.5-6.5a.75.75 0 00-1.06-1.06L12 10.94z"
							/>
						</svg>
					</button>
				</div>
			</div>
			{/* 배경 opacity 0.4 */}
			<div className="overlay-modal" />
		</LoginModalRoot>
	);
}
const LoginModalRoot = styled.div`
	top: 0;
	left: 0;
	right: 0;
	bottom: 0;
	position: fixed;
	overflow: hidden;
	z-index: 1400;
	.content-modal-wrapper {
		width: 400px;
		overflow-y: auto;
		border-radius: 5px;
		background-color: #fff;
		position: absolute;
		overflow: hidden;
	}
	.content-modal-regular {
		top: 50%;
		left: 50%;
		width: 100%;
		max-width: 500px;
		max-height: calc(100vh - 150px);
		transform: translate(-50%, -50%);
		z-index: 5;
	}
	.overlay-modal {
		position: fixed;
		left: 0;
		right: 0;
		top: 0;
		bottom: 0;
		z-index: 4;
		background-color: rgba(0, 0, 0, 0.5);
	}
	.icon-logo {
		font-family: 'Elysio Bold' !important;
		line-height: 0.7;
		font-size: 23px;
	}

	[class^='icon-'],
	[class*=' icon-'] {
		font-family: 'pcblicomoon' !important;
		speak: never;
		font-style: normal;
		font-weight: normal;
		font-feature-settings: normal;
		font-variant: normal;
		text-transform: none;
		line-height: 1;
		-webkit-font-smoothing: antialiased;
		-moz-osx-font-smoothing: grayscale;
	}
`;

export default LoginModal;
